The v-bind directive is used to dynamically bind an attribute to an element. It can be used with almost any HTML attribute. <template> <img v-bind:src="imageUrl" alt="Dynamic Image" /> <!-- Short syntax: --> <img :src="imageUrl" alt="Short Syntax" />
</template> <script>
export default { data() { return { imageUrl: "https://example.com/my-image.jpg", }; },
};
</script> In this example, v-bind:src binds the image URL dynamically from the data object.

