The v-model directive simplifies two-way data binding, especially for forms. <template> <input v-model="username" placeholder="Enter your username" /> <p>Your username: {{ username }}</p>
</template> <script>
export default { data() { return { username: "", }; },
};
</script> This makes the input field reactive, updating the value in the DOM and in the Vue instance’s data simultaneously.

