These directives conditionally render elements based on the evaluation of an expression. <template> <p v-if="isLoggedIn">Welcome back!</p> <p v-else-if="hasAccount">Please log in</p> <p v-else>Create an account</p>
</template> <script>
export default { data() { return { isLoggedIn: false, hasAccount: true, }; },
};
</script> In this example, Vue dynamically renders the appropriate message based on the isLoggedIn and hasAccount conditions.

