The v-for directive is used to loop over data and render elements for each item in the array or object. <template> <ul> <li v-for="(item, index) in items" :key="index">{{ item.name }}</li> </ul>
</template> <script>
export default { data() { return { items: [ { name: "Item 1" }, { name: "Item 2" }, { name: "Item 3" }, ], }; },
};
</script> This efficiently renders a list of items from the items array.

