The v-on directive is used to listen to DOM events. <template> <button v-on:click="handleClick">Click me</button> <!-- Short syntax: --> <button @click="handleClick">Click me</button>
</template> <script>
export default { methods: { handleClick() { alert("Button clicked!"); }, },
};
</script> Here, the v-on:click directive attaches a click event listener to the button.

